    render() {
        return (
            <Container fluid>
                <Row>
                    <div className="scoreHeader ">
                        <Col md="3">
                        Hey
                        </Col>
                        <Col md="3" >
                        Hey
                        </Col>


                    </div>
                </Row>
            </Container>

        );
    }
}

export default ScoreHeader;
